import { Button } from '@chakra-ui/react';
import React from 'react';
import { BrowserRouter as Router,Routes,Route} from 'react-router-dom'
function App() {
  return (
   <Router>
    <div>Hello ji</div>
    <Button colorScheme='linkedin'>Click Me</Button>
    <Routes>
      <Route/>
    </Routes>
   </Router>
  );
}

export default App;
